export const ActionType = {
 GET_ACTIVE_BOOK: `books/getActiveBook`,
};

export const ActionCreator = {
getActiveBook: (activeBookId) => ({
 type: ActionType.GET_ACTIVE_BOOK,
 payload: activeBookId,
})
};
